  console.log(response);
};
export default class reactFbLogin extends Component {
  render() {
    return (
      <div>
        <FacebookLogin
          appId='747798019364772'
          autoLoad={true}
          fields='name,email,picture'
          // callback={responseFacebook}
          icon='fa-facebook'
          callback={responseFacebook}
        />
      </div>
    );
  }
}
